column8:
★りんご・柿など50種類以上の植物を原材料に、<br>
発酵という自然の製法によってつくられた植物発酵食品です。★<br>
<br>
独自の発酵技術により、3年3ヵ月の歳月をかけて、<br>
微生物による酵素の働きで作られました。<br>
<br>
じっくりと発酵・熟成させて、そのエネルギーを<br>
しっかり引き出しています。<br>
生活習慣に不安のある方、健康維持が気になり出した方、<br>
忙しい毎日を送っている方の健康をサポートします。<br>
また、妊娠中の栄養補給にもおすすめです。<br>
<br>
防腐剤や合成保存料は使用しておりません。<br>
<br>
【召し上がり方】<br>
健康補助食品として、1日3～5粒を目安に適宜よく噛んでお召し上がりください。<br>
<br>
【原材料】<br>
植物発酵物（黒糖、リンゴ、カキ、ビワ、その他）、<br>
砂糖、澱粉、食物繊維、黒ゴマ末、<br>
担子菌類抽出エキス、ココア末、グリセリン、<br>
セラック、ゼラチン、カカオ色素、<br>
カルナウバロウ、<br>
（原材料の一部にバナナ、ネーブルオレンジ、<br>
大豆、クルミを含む）<br>
<br>
<br>
【発売元】<br>
万田発酵株式会社<br>
<br>
